import styles from './RightSideLogin.module.css'

const RightSideLogin = () => {
    return(
        <div style={styles.rightSide}>
      <div style={styles.rightSideLoginWrapper}>
        {/* Add content for the right side */}
      </div>
    </div>
    )
}

export default RightSideLogin
